def aic_bic_values(model,components,data):
  AIC_values = []
  BIC_values = []
  for i in range(2,components+1):
    gmm = model(n_components = i)
    gmm.fit(data)
    gmm.aic(data)
    AIC_values.append(gmm.aic(data))
    BIC_values.append(gmm.bic(data))

  return AIC_values, BIC_values

